import React from 'react'
import { useLocation } from 'react-router-dom'
import { Container, Row, Col, Card } from 'react-bootstrap'

const UserInfo = () => {
	const location = useLocation()
	const user = location.state.User || {}
	const servers = location.state.Servers || {}
	console.log(servers)
	//
	return (
		<Container className='mt-4'>
			<Row className='justify-content-center'>
				<Col md={6}>
					<Card>
						<Card.Img
							variant='top'
							src={user?.avatar!==` https://cdn.discordapp.com/avatars/${user?.id}/${user?.avatar}.png`}
						/>
						<Card.Body>
							<Card.Title>{user.username}</Card.Title>
							<Card.Text>
								<strong>ID:</strong> {user.id}
							</Card.Text>
							<Card.Text>
								<strong>Discriminator:</strong> {user.discriminator}
							</Card.Text>
							<Card.Text>
								<strong>Locale:</strong> {user.locale}
							</Card.Text>
							{/* Добавьте другие свойства пользователя по необходимости */}
						</Card.Body>
					</Card>
				</Col>
			</Row>
			<Row className='mt-4'>
				<Col md={12}>
					<h4>User's Servers</h4>
					<div className='d-flex flex-wrap justify-content-between'>
						{servers.map(server => (
							<Card key={server.id} className='mb-3' style={{ width: '18rem' }}>
								<Card.Img
									variant='top'
									src={`https://via.placeholder.com/150/${
										server.icon || 'CCCCCC'
									}/FFFFFF?text=Server`}
								/>
								<Card.Body>
									<Card.Title>{server.name}</Card.Title>
									<Card.Text>
										{server.owner && <strong>Owner</strong>}
									</Card.Text>
									{/* Добавьте другие свойства сервера по необходимости */}
								</Card.Body>
							</Card>
						))}
					</div>
				</Col>
			</Row>
		</Container>
	)
}

export default UserInfo
